                    messageData.idLogMPI = idLogMPI;
                    messageData.idAuth = idAuth;
                    if (messageData.value.name === 'FINGERPRINT' && instruction.value.timeout < 30){
                        if(primeraVezFingerprint === 0){
                            primeraVezFingerprint = 1;
                            window.webkit.messageHandlers.iosListener.postMessage(JSON.stringify(messageData))
                        }
                        //Si no es la primera vez que pasa, no enviar la peticion al SDK
                    } else {
                        window.webkit.messageHandlers.iosListener.postMessage(JSON.stringify(messageData))
                    }
                } catch (err) {
                    this.console.log("Ocurrio error al enviar datos a pagina principal: " + err.message);
                } finally {
                    container = document.getElementById('instructionContainer');
                    container.remove();
                    // Mostrar cargando
                    $(".loader").show();
                }
            }
        } catch (err) {
            this.console.log("Ocurrio error event listener: " + err.message);
        }
    }, false);

    // FUNCION FORM DINAMICO Y CREA IFRAME QUE RECIBIRA RESPUESTA
    function createInstructionIframe(instruction) {
        // Get instruction container element
        container = document.getElementById('instructionContainer');

        // Clean instruction container
        container.innerHTML = '';

        // Create iframe element
        var iframe = document.createElement('iframe');
        iframe.id = 'instructionIframe';
        iframe.name = 'instructionIframe';
        iframe.src = 'about:blank';
        iframe.style.width = instruction.value.target.width+'px';
        iframe.style.height = instruction.value.target.height+'px';
        iframe.style.visibility = instruction.value.target.visible ? 'visible' : 'hidden';
        iframe.style.position = 'relative';

        //Mostrar cargando dependiendo del iframe
        if (instruction.value.target.visible){
            $(".loader").hide();
        } else {
            $(".loader").show();
        }

        // Handle timeout
        if (instruction.value.timeout) {

            variableTimeOut = setTimeout(ManejaTimeOut, instruction.value.timeout * 1000);

            //Funcion ManejaTimeOut
            function ManejaTimeOut() {
                var instructionResultTimeout = {
                    eventName: 'LYRA_AUTH_INSTRUCTION_RESULT',
                    value: {
                        name: instruction.value.name,
                        value: 'TIMEOUT',
                        protocol: instruction.protocol,
                    },
                };
                window.postMessage(JSON.stringify(instructionResultTimeout), '*');
            }
        }

        // Add iframe to container
        container.appendChild(iframe);

        // Create form (siempre hidden) to post
        var form = document.createElement('form');
        form.id = 'instructionForm';
        form.name = 'instructionForm';
        form.target = 'instructionIframe';       // id del IFrame creado que recibira la respuesta
        form.method = instruction.value.http.method;
        form.action = instruction.value.http.url;
        form.style = 'visibility: hidden';

        // Create form body
        Object.keys(instruction.value.http.body).forEach(function (name) {
            form.innerHTML += '<input name="' + name + '" value="' + instruction.value.http.body[name] + '">';
        });

        // Add form to container
        container.appendChild(form);

        // Triger form submit
        form.submit();
    }

      </script>
   </body>
